/*
ba.controllers.BeerController.js
Controller used for displaying beer data in BeersApp.

Copyright (c) 2015

Patrick Crager

*/
(function() { 'use strict';

  angular.module('beersApp.controllers')
  .controller('BeerController', ['BeerDataFactory', 'LoadingFactory', '$modal', 'Messages', BeerController]);

  function BeerController(BeerDataFactory, LoadingFactory, $modal, Messages) {
    // controller as
    var vm = this;

    // list of table headings for table view
    vm.headings = [
      {display: '#',       column: 'number'},
      {display: 'Name',    column: 'name'},
      {display: 'Brewery', column: 'brewery'},
      {display: 'Style',   column: 'style'},
      {display: 'ABV',     column: 'abv'}
    ];
    // array that is populated after API call finishes
    vm.beersList = [];
    vm.isSearching = false;

    // vm functions
    vm.prependBeerNumber = prependBeerNumber;
    vm.changeSorting = changeSorting;
    vm.sortClass = sortClass;
    vm.search = search;

    init();

    function init() {
      // fetch the beers through the list() service call
      LoadingFactory.startLoading();
      BeerDataFactory.list()
        .success(function(data) {
          // sort holds initial sorting values for each list
          angular.forEach(data, function(beerList, index) {
            beerList.sort = {
              column: 'brewery',
              descending: false
            };
          });
          vm.beersList = data;

          // remove the loading indication and show the main content
          LoadingFactory.stopLoading();
        })
        .error(function(error) {
          LoadingFactory.stopLoading();
          alert(Messages.BA_LIST_ERROR);
        });
    }

    // enhances the numbering of "special" beer lists depending on title of list: cask, bottles, etc.
    function prependBeerNumber(number, title) {
        var prepend = '';

        if (title.indexOf('cask') > -1) {
          // F is for firkin/cask!
          prepend = 'F';
        }
        if (title.indexOf('bottle') > -1) {
          // B is for bottle!
          prepend = 'B';
        }

        return prepend + number;
    }

    // updates "sort" variable onclick of table headings
    function changeSorting(sort, column) {
        if (sort.column == column) {
          sort.descending = !sort.descending;
        } else {
          sort.column = column;
          sort.descending = false;
        }
    }

    // returns the appropriate CSS class for the sort direction
    function sortClass(sort, column) {
      if (column !== sort.column) { return; }

      if (!sort.descending) {
        return 'glyphicon-sort-by-attributes';
      } else {
        return 'glyphicon-sort-by-attributes-alt';
      }
    }

    // calls the search API and opens a modal window upon success
    function search(beer) {
      vm.isSearching = true;

      BeerDataFactory.search(beer.brewery, beer.name)
        .success(function(data) {
          var modal = $modal.open({
            templateUrl: 'templates/modalSearchResult.html',
            controller: 'SearchResultController',
            controllerAs: 'vm',
            resolve: {
              beer: function() { return data; }
            }
          });
          modal.result.finally(function() {
            vm.isSearching = false;
          });
        })
        .error(function(error) {
          var errorType;
          if (error.response) {
              errorType = error.response.body.meta.error_type;
          }

          if (error.code === 404) {
            alert(Messages.BA_UNTAPPD_SEARCH_NOT_FOUND);
          } else if (errorType && errorType === 'invalid_token') {
            alert(Messages.BA_UNTAPPD_TOKEN_EXPIRED);
            window.location.replace('/nodejs/beer/logout');
          } else {
            alert(Messages.BA_UNTAPPD_SEARCH_ERROR);
          }

          vm.isSearching = false;
        });
    }
  }

})();

/*
ba.controllers.MainController.js
Main controller of BeersApp.

Copyright (c) 2015

Patrick Crager

*/
(function() { 'use strict';

  angular.module('beersApp.controllers')
  .controller('MainController', ['CookieFactory', 'LoadingFactory', 'AppConfig', MainController]);

  function MainController(CookieFactory, LoadingFactory, AppConfig) {
    // controller as
    var vm = this;

    vm.loginURL = AppConfig.BA_UNTAPPD_LOGIN_URL;
    vm.loginURL = vm.loginURL.replace('{0}', AppConfig.BA_UNTAPPD_CLIENTID);
    vm.loginURL = vm.loginURL.replace('{1}', encodeURI(AppConfig.BA_UNTAPPD_CALLBACK_URL));
    vm.logoutURL = AppConfig.BA_LOGOUT_URL;
    vm.isAuthenticated = CookieFactory.isAuthenticated;

    // vm functions
    vm.collapseNav = collapseNav;
    vm.isLoading = isLoading;
    vm.isLoaded = isLoaded;

    // collapses the expanded navigation bar
    function collapseNav() {
      $('.collapse.in').collapse('hide');
    }

    // return the current loading indication
    function isLoading() {
      return LoadingFactory.isLoading;
    }

    // return the status of the initial load
    function isLoaded() {
      return LoadingFactory.isLoaded;
    }
  }

})();

/*
ba.controllers.SearchResultController.js
Controller used for displaying search results in BeersApp.

Copyright (c) 2015

Patrick Crager

*/
(function() { 'use strict';

  angular.module('beersApp.controllers')
  .controller('SearchResultController', ['CookieFactory', '$modalInstance', 'AppConfig', 'beer', SearchResultController]);

  function SearchResultController(CookieFactory, $modalInstance, AppConfig, beer) {
    // controller as
    var vm = this;

    vm.beer = beer;
    vm.isAuthenticated = CookieFactory.isAuthenticated;

    // vm functions
    vm.close = close;
    vm.checkin = checkin;

    // close the modal
    function close() {
      $modalInstance.dismiss();
    }

    // try to launch untappd to the beer's page if on a mobile phone
    // otherwise launch the default browser to the beer on untappd's website
    function checkin(bid) {
      var isMobile = /(iPhone|Android|IEMobile)/.test(navigator.userAgent);

      if (isMobile) {
        document.location = AppConfig.BA_UNTAPPD_APP_SCHEME + bid;
      } else {
        window.open(AppConfig.BA_UNTAPPD_URL_SCHEME + bid);
      }
    }
  }

})();

